import React from "react";

function Icon(props){
 let style = {
               color: props.color, 
               cursor: "pointer",
            };
 let classes = [props.classes, "my-tooltip"].join(" ");
 console.log(classes)
 return  (
   <span  style = {style}>
      <i className={classes}>
         <span className="my-tooltiptext">{props.toolTipText}</span>
      </i>
   </span>
);
};



export default Icon;
